import { Component } from '@angular/core';

@Component({
  selector: 'app-subject-edit',
  templateUrl: './subject-edit.component.html',
  styleUrls: ['./subject-edit.component.scss']
})
export class SubjectEditComponent {

}
<div class="p-[30px] ">
    <h3 class="font-[550px] text-[32px] text-[#2c323f] ">Edit Subject</h3>
    <div class="lg:flex bg-white p-4">
        <input class="block my-[28px] w-full p-[12px] text-[20px] rounded-[6px] border border-gray-400 outline-blue-500 lg:w-[318px]" type="text" placeholder="Search by ID ..." />
        <input class="block my-[28px] w-full p-[12px] text-[20px] rounded-[6px] border border-gray-400 outline-blue-500 lg:w-[318px] lg:mx-[32px]" type="text" placeholder="Search by Name ..." />
        <input class="block my-[28px] w-full p-[12px] text-[20px] rounded-[6px] border border-gray-400 outline-blue-500 lg:w-[430px]" type="text" placeholder="Search by Class ..." />
        <button
            class="border rounded-[8px] mb-[24px] text-[22px] font-semibold py-[16px] px-[48px] cursor-pointer hover:bg-[#18aefa] bg-[#3d5ee1]  text-[white] uppercase lg:ml-[24px] lg:px-[24px] lg:py-[12px] lg:self-end lg:font-[500]">
            Submit
        </button>
    </div>
   
</div>
